//import { ReactComponent } from '*.svg';
import axios from 'axios';
import React from 'react'
import { useParams } from 'react-router-dom';

function withParams(Component) {
    return props => <Component {...props} params={useParams()} />;
  }

class AnalyzeData extends React.Component{

    state = {
        clinicalData : []
    }
    componentWillMount(){
        const {patientId} = this.props.params
        axios.get("http://localhost:8080/clinicalservices/api/patients/analyze/1"+patientId).then(res=>{
            this.setState(res.data)
        })
    }
    render(){
        const {patientId} = this.props.params
        return(<div>
            <h2>Patient Details: {patientId}</h2>
            First Name: {this.state.firstName}<br/>
            Last Name: {this.state.lastName}<br/>
            Age: {this.state.age}<br/>
        </div>)
    }
}

export default withParams(AnalyzeData);
